import React from "react";
import Heading from "./Heading";
import Para from "./Para";
import Lists from "./Lists";
import { Button } from "@mui/material";

function App() {
  return (
    <>
      <Heading />
      <Para />
      <Lists />
      <Heading />
    </>
  );
}

export default App;
